import React, { useEffect, useState } from 'react';
import API from '../utils/api';
import NestEggChart from '../components/NestEggChart';

function Dashboard() {
  const [userData, setUserData] = useState({
    name: "",
    scenarioName: "",
    currentNestEgg: 0,
    annualReturnRate: 4,
    currentSalary: 70000,
    annualContribution: 10,
    salaryIncrease: 2,
    retirementAge: 68,
    activeRetirementIncome: 60000,
    postActiveRetirementIncome: 40000,
    married: false,
    socialSecurity: false,
  });
  
  const [projectionData, setProjectionData] = useState(null);
  const [savedScenarios, setSavedScenarios] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    API.get('/user/me')
      .then(res => setUserData(prev => ({ ...prev, name: res.data.name })))
      .catch(err => setError("Failed to load user data"));
  }, []);

  const calculateProjections = () => {
    let years = [];
    let currentAge = new Date().getFullYear() - userData.age;
    let retirementYear = currentAge + (userData.retirementAge - userData.age);
    let nestEgg = userData.currentNestEgg;
    let salary = userData.currentSalary;
    let contributions = userData.annualContribution;
    let returnRate = userData.annualReturnRate / 100;
    let salaryIncrease = userData.salaryIncrease / 100;
    let activeIncome = userData.activeRetirementIncome;
    let postActiveIncome = userData.postActiveRetirementIncome;
    let yearlyWithdrawals;
    let maxNestEgg = 0;
    let totalRetirementDollars = 0;

    for (let i = currentAge; i <= 100; i++) {
      if (i < retirementYear) {
        nestEgg += salary * (contributions / 100);
        nestEgg *= (1 + returnRate);
        salary *= (1 + salaryIncrease);
      } else {
        yearlyWithdrawals = i < 80 ? activeIncome : postActiveIncome;
        nestEgg -= yearlyWithdrawals;
        totalRetirementDollars += yearlyWithdrawals;
        nestEgg *= (1 + returnRate);
      }
      
      maxNestEgg = Math.max(maxNestEgg, nestEgg);
      years.push({ year: i, balance: nestEgg });
      if (nestEgg <= 0) break;
    }

    setProjectionData({ years, maxNestEgg, totalRetirementDollars });
  };

  const saveScenario = () => {
    setSavedScenarios([...savedScenarios, { ...userData, projectionData }]);
  };

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setUserData(prev => ({ 
      ...prev, 
      [name]: type === "checkbox" ? checked : parseFloat(value) || 0
    }));
  };

  return (
    <div className="p-6 max-w-6xl mx-auto grid grid-cols-1 md:grid-cols-2 gap-6">
      <div className="bg-white p-6 rounded shadow-md">
        <h2 className="text-xl font-bold mb-4">Retirement Calculator</h2>
        
        {Object.keys(userData).map((key) => (
          key !== 'name' && (
            <div key={key} className="mb-4">
              <label className="block mb-2 capitalize">{key.replace(/([A-Z])/g, ' $1')}</label>
              <input 
                type={typeof userData[key] === "boolean" ? "checkbox" : "number"} 
                name={key} 
                checked={typeof userData[key] === "boolean" ? userData[key] : undefined}
                value={typeof userData[key] !== "boolean" ? userData[key] : undefined}
                onChange={handleChange} 
                className="w-full p-2 border rounded" 
              />
            </div>
          )
        ))}

        <button 
          onClick={calculateProjections} 
          className="w-full bg-blue-500 text-white p-2 rounded mt-4">
          Calculate
        </button>
        <button 
          onClick={saveScenario} 
          className="w-full bg-green-500 text-white p-2 rounded mt-4">
          Save Scenario
        </button>
      </div>

      <div className="bg-white p-6 rounded shadow-md">
        <h2 className="text-xl font-bold mb-4">Your total savings at retirement</h2>
        <p className="text-3xl font-bold text-blue-600 mb-4">${projectionData?.years?.slice(-1)[0]?.balance.toFixed(2) || 0}</p>
        <p className="text-green-500">{projectionData && projectionData.years?.slice(-1)[0]?.balance > 0 ? "You're on track" : "Your savings may run out"}</p>
        <p className="text-gray-600">Max Savings: <span className="font-bold">${projectionData?.maxNestEgg.toFixed(2) || 0}</span></p>
        <p className="text-gray-600">Total Retirement Dollars Received: <span className="font-bold">${projectionData?.totalRetirementDollars.toFixed(2) || 0}</span></p>
        
        <h2 className="text-lg font-bold mt-6">Your retirement summary</h2>
        <p className="text-gray-600">Your plan provides an estimated savings of ${projectionData?.years?.slice(-1)[0]?.balance.toFixed(2) || 0} when you retire.</p>
        
        <div className="mt-6">
          {projectionData ? (
            <NestEggChart dataPoints={projectionData.years} />
          ) : (
            <p className="text-gray-600">Click Calculate to see projections...</p>
          )}
        </div>
      </div>

      <div className="bg-white p-6 rounded shadow-md col-span-2">
        <h2 className="text-xl font-bold mb-4">Saved Scenarios</h2>
        {savedScenarios.length > 0 ? (
          <ul>
            {savedScenarios.map((scenario, index) => (
              <li key={index} className="mb-2 p-2 border rounded">
                <strong>{scenario.scenarioName}</strong>: Max Savings ${scenario.projectionData.maxNestEgg.toFixed(2)} | Total Retirement ${scenario.projectionData.totalRetirementDollars.toFixed(2)}
              </li>
            ))}
          </ul>
        ) : (
          <p className="text-gray-600">No saved scenarios yet.</p>
        )}
      </div>
    </div>
  );
}

export default Dashboard;
